        {title:"The Sound cloud You loved is doomed",type:"travel",date:"August 21 2017"}
      ]
    }
  }

  render(){
    return(
      <React.Fragment>
        <HeaderMain linklist={this.state.header}></HeaderMain>
      </React.Fragment>
    )
  }
}


export default App;
